import {Link} from 'react-router-dom'

import {EachCategory, Name} from './styledComponents'

const CategoryCard = props => {
  const {category, changeCategory, isActive} = props
  const {name, icon, id, path} = category

  return (
    <Link to={path}>
      <EachCategory>
        {icon}
        <Name>{name}</Name>
      </EachCategory>
    </Link>
  )
}
export default CategoryCard
